import { Flex } from "@chakra-ui/layout"
import React, { useEffect,useState } from "react"
import { useParams } from 'react-router'
import { getPoiData } from "../../services/ViewPOIServices"
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';


export const ViewPois=()=>{
    const [data,setData]=useState({})
    const {place_id}=useParams()

    useEffect( ()=>{
            getPoiData(place_id).then((r)=>{
                setData(r)
                
            })
            
        },[place_id] )
    return(
        <>
        

        <Flex >
        <Carousel>
                <div>
                    <img src="https://images.unsplash.com/photo-1632148734094-0017109ff3a2?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80" />
                    <p className="legend">Legend 1</p>
                </div>
                <div>
                    <img src="https://images.unsplash.com/photo-1632148734094-0017109ff3a2?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80" />
                    <p className="legend">Legend 2</p>
                </div>
                <div>
                    <img src="assets/3.jpeg" />
                    <p className="legend">Legend 3</p>
                </div>
            </Carousel>
        </Flex>
        
        
        
        </>
    )
}
